import Dialog from "../Dialog/Dialog";
import girl from "../assets/dance.webp";
import list from "../assets/list.png";
import background from "../assets/back.gif";
import text from "../assets/text.png";
import file from "../assets/file.png";
import paragua from "../assets/paragua.png";
import music from "../assets/music.png";
import abilities from "../assets/abilities.png";
import grocery from "../assets/GROCERYT.png";
import { useEffect } from "react";

function MainPage() {
  return (
    <>
      <div
        style={{
          width: "100px",
          height: "60vh",
          position: "absolute",
          display: "flex",
          alignItems: "center",
          flexDirection: "column",
          marginLeft: "30px",
        }}
      >
        <div
          style={{
            display: "flex",
            alignItems: "center",
            flexDirection: "column",
            cursor: "pointer",
          }}
        >
          <img
            src={text}
            style={{
              width: "30px",
              marginTop: "20px",
              marginLeft: "-5px",
              marginBottom: "10px",
              filter: "hue-rotate(150deg)",
              imageRendering: "-moz-crisp-edges",
            }}
          ></img>
          <div style={{ color: "white" }}>GR0CE3RY_LI57.TXT</div>
        </div>

        <div
          style={{
            display: "flex",
            alignItems: "center",
            flexDirection: "column",
            cursor: "pointer",
          }}
        >
          <img
            src={abilities}
            style={{
              width: "60px",
              marginTop: "20px",
              marginLeft: "-5px",
              filter: "hue-rotate(150deg)",
              imageRendering: "-moz-crisp-edges",
            }}
          ></img>
          <div style={{ color: "white" }}>4B1LITIES.EXE</div>
        </div>

        <div
          style={{
            display: "flex",
            alignItems: "center",
            flexDirection: "column",
            cursor: "pointer",
          }}
        >
          <img
            src={paragua}
            style={{
              width: "60px",
              marginTop: "20px",
              marginLeft: "-5px",
              filter: "hue-rotate(150deg)",
              imageRendering: "-moz-crisp-edges",
            }}
          ></img>
          <div style={{ color: "white" }}>CONT4C7.INFO</div>
        </div>

        <div
          style={{
            display: "flex",
            alignItems: "center",
            flexDirection: "column",
            cursor: "pointer",
          }}
        >
          <img
            src={file}
            style={{
              width: "35px",
              marginTop: "20px",
              marginLeft: "-5px",
              filter: "hue-rotate(150deg)",
              imageRendering: "-moz-crisp-edges",
            }}
          ></img>
          <div style={{ color: "white" }}>4NIM3_GIRL.EXE</div>
        </div>

        <div
          style={{
            display: "flex",
            alignItems: "center",
            flexDirection: "column",
            cursor: "pointer",
          }}
        >
          <img
            src={music}
            style={{
              width: "60px",
              marginTop: "20px",
              marginLeft: "-5px",
              imageRendering: "-moz-crisp-edges",
            }}
          ></img>
          <div style={{ color: "white" }}>CHRISTTT - RESIDUE.MP3</div>
        </div>
      </div>

      <div
        style={{ backgroundColor: "black" }}
        className="line anim-typewriter"
      >
        It's all a matter of perspective. And maybe we thought we were living
        one story, when if we look at it a little different, we can reframe
        everything.
      </div>
      <div
        style={{
          width: "100%",
          height: "100vh",
          display: "flex",
          justifyContent: "center",
          alignItems: "flex-end",
        }}
      >
        <img
          src={background}
          style={{
            objectFit: "cover",
            width: "100vw",
            height: "100vh",
            position: "fixed",
            top: 0,
            left: 0,
            opacity: "20%",
          }}
        />
      </div>

      <Dialog
        text={
          <div style={{ display: "flex", justifyContent: "center" }}>
            <img src={girl} style={{ width: "50px", height: "60px" }}></img>
          </div>
        }
        title="4NIM3_GIRL.EXE"
        y="40"
        x="65"
      />

      <Dialog
        text={
          <ul>
            <li>Coffee ☕</li>
            <li>Soap 🧼</li>
            <li>Bread 🍞</li>
          </ul>
        }
        title="GR0C3RY_L157.TXT"
        y="20"
        x="40"
      />
      <Dialog
        text={
          <ul>
            <li>
              <b>Semi-senior</b> Angular developer
            </li>
            <li>
              <b>Junior</b> React Developer
            </li>
            <li>UX/UI Designer</li>
            <li>Friend ※\(^o^)/※ </li>
          </ul>
        }
        title="4B1LITIES.TXT"
        y="70"
        x="60"
      />

      <Dialog
        text={<div>ttomasrivero@gmail.com</div>}
        title="CONT4C7.INFO"
        y="80"
        x="30"
      />
    </>
  );
}

export default MainPage;
